package com.brothergeol.servlet.web.frontcontroller.v5;import com.brothergeol.servlet.web.frontcontroller.v2.controller.MemberFormControllerV2;import com.brothergeol.servlet.web.frontcontroller.v2.controller.MemberListControllerV2;import com.brothergeol.servlet.web.frontcontroller.v2.controller.MemberSaveControllerV2;import com.brothergeol.servlet.web.frontcontroller.v3.controller.MemberFormControllerV3;import com.brothergeol.servlet.web.frontcontroller.v3.controller.MemberListControllerV3;import com.brothergeol.servlet.web.frontcontroller.v3.controller.MemberSaveControllerV3;import com.brothergeol.servlet.web.frontcontroller.v4.controller.MemberFormControllerV4;import com.brothergeol.servlet.web.frontcontroller.v4.controller.MemberListControllerV4;import com.brothergeol.servlet.web.frontcontroller.v4.controller.MemberSaveControllerV4;import java.util.HashMap;import java.util.Map;import org.springframework.context.annotation.Bean;import org.springframework.context.annotation.Configuration;@Configurationpublic class HandlerMappingConfig {    @Bean    public HandlerMappingMap handlerMappingMap() {        return new HandlerMappingMap(registerHandlers());    }    private Map<String, Object> registerHandlers() {        HashMap<String, Object> urlMap = new HashMap<>();        urlMap.put("/front-controller/v5/v2/members/new-form", new MemberFormControllerV2());        urlMap.put("/front-controller/v5/v2/members/save", new MemberSaveControllerV2());        urlMap.put("/front-controller/v5/v2/members", new MemberListControllerV2());        urlMap.put("/front-controller/v5/v3/members/new-form", new MemberFormControllerV3());        urlMap.put("/front-controller/v5/v3/members/save", new MemberSaveControllerV3());        urlMap.put("/front-controller/v5/v3/members", new MemberListControllerV3());        urlMap.put("/front-controller/v5/v4/members/new-form", new MemberFormControllerV4());        urlMap.put("/front-controller/v5/v4/members/save", new MemberSaveControllerV4());        urlMap.put("/front-controller/v5/v4/members", new MemberListControllerV4());        return urlMap;    }}